import React from "react"
import SearchBar from "./SubComponents/SearchBar"
import Faculty from "./SubComponents/Faculty"
import Domain from "./SubComponents/Domain"
//import { search_value } from "./SubComponents/SearchBar"
//import { facultycheckedItems } from "./SubComponents/Faculty"

const Content = (props) => {
  const facultycheckedItems = props.facultycheckedItems;
  return (
    <section class="content">
      <div class="content-container">
        <SearchBar/>
        <Faculty/>
        <Domain/>

        <p>{facultycheckedItems}</p>
        
      </div>
    </section>
  )
}

export default Content
